                title1:
                  '<div><p>Note(s) <strong>[2020.01]</strong></p><ul class="none"><li>In this class, the following terms or expressions are used with the meaning indicated:<ul class="bullet"><li>“simulated smoking devices” means devices simulating the act of smoking without burning tobacco, e.g. so called electronic cigarettes;</li><li>“cigarette” means:<ul class="bullet"><li>a small tube of wrapper containing tobacco or tobacco substitutes which people smoke by igniting it directly and where the tobacco (or the tobacco substitute) is burned;</li><li>in a broader sense it also means a small tube of wrapper containing tobacco or tobacco substitutes which is associated with a heat source at manufacturing or inserted by the user in a device containing a heat source and where the tobacco (or the tobacco substitute) is heated without being burned. In this broader sense, the word “rod” is also often used in place of cigarette.</li></ul></li></ul></li></ul></div>',
