                  '<div><p>Note(s) <strong>[2015.01]</strong></p><ul class="number"><li>This class <u>covers:</u><ul class="bullet"><li><u></u>working of metallic <a oncontextmenu="return false;" rel="term" onclick="IPCPUB.scheme.show_term(\'1539\', \'materials\'); return false;" href="#1539">materials</a>;</li><li>working of non-metallic <a oncontextmenu="return false;" rel="term" onclick="IPCPUB.scheme.show_term(\'1539\', \'materials\'); return false;" href="#1539">materials</a>, provided that the methods applied are similar to those used in metal-working and not provided for elsewhere.</li></ul></li><li>This class <u>does not cover </u>:<ul class="bullet"><li>combinations of operations covered by different subclasses of class  <a rel="symbol" onclick="IPCPUB.scheme.go_to_symbol(\'B21\');return false;" href="/?notion=scheme&version=20230101&symbol=B21">B21</a>, which are covered by subclass  <a rel="symbol" onclick="IPCPUB.scheme.go_to_symbol(\'B23P\');return false;" href="/?notion=scheme&version=20230101&symbol=B23P">B23P</a>;</li><li>combinations of operations covered by any particular subclass of class  <a rel="symbol" onclick="IPCPUB.scheme.go_to_symbol(\'B21\');return false;" href="/?notion=scheme&version=20230101&symbol=B21">B21</a> with operations covered by other classes, e.g. with operations involving removal of material, which are also covered by subclass  <a rel="symbol" onclick="IPCPUB.scheme.go_to_symbol(\'B23P\');return false;" href="/?notion=scheme&version=20230101&symbol=B23P">B23P</a>, except that if the operations covered by the other classes are subsidiary to the operations properly covered by a single subclass of  <a rel="symbol" onclick="IPCPUB.scheme.go_to_symbol(\'B21\');return false;" href="/?notion=scheme&version=20230101&symbol=B21">B21</a> the combination is classified in that subclass.</li></ul></li></ul></div>',
