                kind: "n",
                entrytype: "K",
                amendment: "U",
                title1:
                  '<div><p>Note(s) <strong>[2015.01]</strong></p><ul class="number"><li>This class <u>covers  </u>:<ul class="bullet"><li>working of metallic <a oncontextmenu="return false;" rel="term" onclick="IPCPUB.scheme.show_term(\'1539\', \'materials\'); return false;" href="#1539">materials</a>;</li><li>working of non-metallic <a oncontextmenu="return false;" rel="term" onclick="IPCPUB.scheme.show_term(\'1539\', \'materials\'); return false;" href="#1539">materials</a>, provided that the methods applied are similar to those used in metal-working and not provided for elsewhere;</li><li><a oncontextmenu="return false;" rel="term" onclick="IPCPUB.scheme.show_term(\'1523\', \'features\'); return false;" href="#1523">features</a>, specific to machine tools, which relate to a requirement or problem of a nature which is not peculiar to a particular kind of machine tool, e.g. feeding work, which are covered by subclass  <a rel="symbol" onclick="IPCPUB.scheme.go_to_symbol(\'B23Q\');return false;" href="/?notion=scheme&version=20230101&symbol=B23Q">B23Q</a>, although the realisation of these features may differ according to the kind of machine tool concerned. The said subclass covers such features, in general, even if the feature or a specific function, in any particular case, is to some extent peculiar to, or is claimed only for, machine tools designed for one particular operation; only in exceptional cases are such features classified in the subclass for the machine tool concerned. Certain features of this general nature are, however, referred to subclasses relating to particular metal-working operations, especially  <a rel="symbol" onclick="IPCPUB.scheme.go_to_symbol(\'B23B\');return false;" href="/?notion=scheme&version=20230101&symbol=B23B">B23B</a>, in which case the subclasses in question are not restricted, in respect of those features, to the kind of machine tool with which they are primarily concerned.</li></ul></li><li>In this class, the following terms or expressions are used with the meanings indicated:<ul class="bullet"><li>"kind of operations" and similar expressions relate to such metal-working operations as boring, drilling, milling and grinding;</li><li>"kind of machine" means a machine designed for a particular kind of metal-working operation (e.g. a lathe);</li><li>"form of machine" means a machine of a particular kind adapted or arranged for a particular way of working or for particular work, e.g. face-plate lathe, tailstock lathe, turret lathe;</li><li>"different machines" covers different forms of machines for performing the same type of metal-working operation, e.g. vertical and horizontal boring machines.</li></ul></li><li>If details, components, or accessories have no <a oncontextmenu="return false;" rel="term" onclick="IPCPUB.scheme.show_term(\'1522\', \'essential\'); return false;" href="#1522">essential</a> <a oncontextmenu="return false;" rel="term" onclick="IPCPUB.scheme.show_term(\'1523\', \'feature\'); return false;" href="#1523">feature</a> specific to machine tools, the more general class, e.g.  <a rel="symbol" onclick="IPCPUB.scheme.go_to_symbol(\'F16\');return false;" href="/?notion=scheme&version=20230101&symbol=F16">F16</a>, takes precedence.</li></ul></div>',
