                kind: "n",
                entrytype: "K",
                amendment: "U",
                title1:
                  '<div><p>Note(s) <a rel="versions" data-content="4<br>2010.01" href="#" oncontextmenu="return false;" onclick="return false;"><strong>[2010.01]</strong></a></p><ul class="number"><li>This class <u>does not cover</u> the working of <a oncontextmenu="return false;" rel="term" onclick="IPCPUB.scheme.show_term(\'1548\', \'plastics\'); return false;" href="#1548">plastics</a> sheet <a oncontextmenu="return false;" rel="term" onclick="IPCPUB.scheme.show_term(\'1539\', \'material\'); return false;" href="#1539">material</a> in a manner analogous to the working of paper, which is covered by class  <a rel="symbol" onclick="IPCPUB.scheme.go_to_symbol(\'B31\');return false;" href="/?notion=scheme&version=20230101&symbol=B31">B31</a>.</li><li>In this class, the following term is used with the meaning indicated:<ul class="bullet"><li>"<a oncontextmenu="return false;" rel="term" onclick="IPCPUB.scheme.show_term(\'1548\', \'plastics\'); return false;" href="#1548">plastics</a>" means macromolecular compounds or compositions based on such compounds.</li></ul></li><li>In this class, the following rules apply:<ul class="alpha"><li>The working of <a oncontextmenu="return false;" rel="term" onclick="IPCPUB.scheme.show_term(\'1548\', \'plastics\'); return false;" href="#1548">plastics</a> is, as far as possible, classified primarily according to the particular shaping technique used, e.g. in subclass  <a rel="symbol" onclick="IPCPUB.scheme.go_to_symbol(\'B29C\');return false;" href="/?notion=scheme&version=20230101&symbol=B29C">B29C</a>.</li><li>Classification according to production of particular articles in subclass  <a rel="symbol" onclick="IPCPUB.scheme.go_to_symbol(\'B29D\');return false;" href="/?notion=scheme&version=20230101&symbol=B29D">B29D</a> is restricted to:<ul class="roman"><li><a oncontextmenu="return false;" rel="term" onclick="IPCPUB.scheme.show_term(\'4001\', \'aspects\'); return false;" href="#4001">aspects</a> which are <a oncontextmenu="return false;" rel="term" onclick="IPCPUB.scheme.show_term(\'1529\', \'characteristic\'); return false;" href="#1529">characteristic</a> for the production of a particular article, and not classifiable in subclass  <a rel="symbol" onclick="IPCPUB.scheme.go_to_symbol(\'B29B\');return false;" href="/?notion=scheme&version=20230101&symbol=B29B">B29B</a> or  <a rel="symbol" onclick="IPCPUB.scheme.go_to_symbol(\'B29C\');return false;" href="/?notion=scheme&version=20230101&symbol=B29C">B29C</a>;</li><li>combined operations for making the particular article which are not fully classifiable in subclass  <a rel="symbol" onclick="IPCPUB.scheme.go_to_symbol(\'B29C\');return false;" href="/?notion=scheme&version=20230101&symbol=B29C">B29C</a>.</li></ul></li><li><a oncontextmenu="return false;" rel="term" onclick="IPCPUB.scheme.show_term(\'1543\', \'Products\'); return false;" href="#1543">Products</a> <u>per se</u> are not classified in this class. However, if a <a oncontextmenu="return false;" rel="term" onclick="IPCPUB.scheme.show_term(\'1543\', \'product\'); return false;" href="#1543">product</a> is characterised by the way it is produced and not by its structure or composition, the production method should be classified in this class.</li></ul></li><li>The codes of subclass  <a rel="symbol" onclick="IPCPUB.scheme.go_to_symbol(\'B29K\');return false;" href="/?notion=scheme&version=20230101&symbol=B29K">B29K</a> are <u>only</u> for <a oncontextmenu="return false;" rel="term" onclick="IPCPUB.scheme.show_term(\'1547\', \'use\'); return false;" href="#1547">use</a> as indexing codes associated with subclasses  <a rel="symbol" onclick="IPCPUB.scheme.go_to_symbol(\'B29B\');return false;" href="/?notion=scheme&version=20230101&symbol=B29B">B29B</a>,  <a rel="symbol" onclick="IPCPUB.scheme.go_to_symbol(\'B29C\');return false;" href="/?notion=scheme&version=20230101&symbol=B29C">B29C</a>, or  <a rel="symbol" onclick="IPCPUB.scheme.go_to_symbol(\'B29D\');return false;" href="/?notion=scheme&version=20230101&symbol=B29D">B29D</a> so as to provide information concerning moulding materials or materials for reinforcements, fillers or preformed parts, e.g. inserts.</li><li>The codes of subclass  <a rel="symbol" onclick="IPCPUB.scheme.go_to_symbol(\'B29L\');return false;" href="/?notion=scheme&version=20230101&symbol=B29L">B29L</a> are <u>only</u> for <a oncontextmenu="return false;" rel="term" onclick="IPCPUB.scheme.show_term(\'1547\', \'use\'); return false;" href="#1547">use</a> as indexing codes associated with subclass  <a rel="symbol" onclick="IPCPUB.scheme.go_to_symbol(\'B29C\');return false;" href="/?notion=scheme&version=20230101&symbol=B29C">B29C</a>, so as to provide information concerning the articles produced by the techniques classified in subclass  <a rel="symbol" onclick="IPCPUB.scheme.go_to_symbol(\'B29C\');return false;" href="/?notion=scheme&version=20230101&symbol=B29C">B29C</a>.</li></ul></div>',
