                  '<div><p>Note(s) </p><ul class="number"><li>This class <u>covers</u> subject matter restricted to <a oncontextmenu="return false;" rel="term" onclick="IPCPUB.scheme.show_term(\'4675\', \'adaptations\'); return false;" href="#4675">adaptations</a> or associations of <a oncontextmenu="return false;" rel="term" onclick="IPCPUB.scheme.show_term(\'1532\', \'handling\'); return false;" href="#1532">handling</a> sheets, webs, or blanks peculiar to paper-working, e.g. bag or box making, machinery.</li><li>This class <u>does not cover</u>:<ul class="bullet"><li>making articles directly from paper pulp, which is covered by  <a rel="symbol" onclick="IPCPUB.scheme.go_to_symbol(\'D21J\');return false;" href="/?notion=scheme&version=20230101&symbol=D21J">D21J</a>;</li><li><a oncontextmenu="return false;" rel="term" onclick="IPCPUB.scheme.show_term(\'1532\', \'handling\'); return false;" href="#1532">handling</a> sheets, webs or blanks of wider applicability, irrespective of whether described or claimed only for paper-working machinery, which is regarded as being of a more comprehensive nature and is covered by  <a rel="symbol" onclick="IPCPUB.scheme.go_to_symbol(\'B65H\');return false;" href="/?notion=scheme&version=20230101&symbol=B65H">B65H</a>.</li></ul></li><li>Sheet <a oncontextmenu="return false;" rel="term" onclick="IPCPUB.scheme.show_term(\'1539\', \'materials\'); return false;" href="#1539">materials</a> made from <a oncontextmenu="return false;" rel="term" onclick="IPCPUB.scheme.show_term(\'1548\', \'plastics\'); return false;" href="#1548">plastics</a>, laminated <a oncontextmenu="return false;" rel="term" onclick="IPCPUB.scheme.show_term(\'1539\', \'materials\'); return false;" href="#1539">materials</a> and metal foils are examples of <a oncontextmenu="return false;" rel="term" onclick="IPCPUB.scheme.show_term(\'1539\', \'materials\'); return false;" href="#1539">materials</a> that can be worked in a manner analogous to paper.</li></ul></div>',
