                  '<div><p>Note(s) </p><ul class="none"><li>In this class, the following expression is used with the meaning indicated:<ul class="bullet"><li>"railway systems" <u>covers</u>:<ul class="alpha"><li>systems in which trains or individual passenger vehicles or load carriers run on, or are guided by, ground or elevated tracks defined by rails, ropes, cables, or other guiding elements for wheels, rollers, or sliding anti-friction devices;</li><li>systems in which carriers or impellers for persons or loads are attached to, e.g. suspended from, a guided traction rope or cable which determines their path of movement;</li><li>power-and-free systems of either of the above types in which vehicles, load-carriers or loads may be selectively coupled to, or uncoupled from, continuous traction members, e.g. cables, chains;</li></ul></li><li>"railway systems" <u>does not cover</u>:<ul class="alpha"><li>conveyors with load-carriers permanently attached to a continuous traction element, e.g. chain conveyors, which are covered by group  <a rel="symbol" onclick="IPCPUB.scheme.go_to_symbol(\'B65G0017000000\');return false;" href="/?notion=scheme&version=20230101&symbol=B65G0017000000">B65G 17/00</a>;</li><li>conveyors moving articles or <a oncontextmenu="return false;" rel="term" onclick="IPCPUB.scheme.show_term(\'1539\', \'materials\'); return false;" href="#1539">materials</a> over a supporting surface or underlying <a oncontextmenu="return false;" rel="term" onclick="IPCPUB.scheme.show_term(\'1539\', \'material\'); return false;" href="#1539">material</a>, e.g. scraper conveyors, which are covered by group  <a rel="symbol" onclick="IPCPUB.scheme.go_to_symbol(\'B65G0019000000\');return false;" href="/?notion=scheme&version=20230101&symbol=B65G0019000000">B65G 19/00</a>.</li></ul></li></ul></li></ul></div>',
