                entrytype: "K",
                amendment: "U",
                title1:
                  '<div><p>Note(s) <strong>[7]</strong></p><ul class="number"><li>This class <u>covers</u> microstructural devices or systems, including at least one <a oncontextmenu="return false;" rel="term" onclick="IPCPUB.scheme.show_term(\'1522\', \'essential\'); return false;" href="#1522">essential</a> element or formation characterised by its very small size, typically within the range of 10<sup>-4</sup> to 10<sup>-7</sup> meters, i.e. its significant <a oncontextmenu="return false;" rel="term" onclick="IPCPUB.scheme.show_term(\'1523\', \'features\'); return false;" href="#1523">features</a> can not, in at least one dimension, be completely discerned without the <a oncontextmenu="return false;" rel="term" onclick="IPCPUB.scheme.show_term(\'1547\', \'use\'); return false;" href="#1547">use</a> of an optical microscope.</li><li>In this class, the following expressions are used with the meaning indicated:<ul class="bullet"><li>"microstructural devices" covers:<ul class="roman"><li>micromechanical devices comprising movable, flexible or deformable elements; and</li><li>three-dimensional structures without movable, flexible or deformable elements, comprising microformations designed to accomplish an <a oncontextmenu="return false;" rel="term" onclick="IPCPUB.scheme.show_term(\'1522\', \'essential\'); return false;" href="#1522">essential</a> structural function for interacting with their environment, as opposed to purely electronic or chemical functions, regardless of whether the structures are combined with microelectronic devices or formed from specific <a oncontextmenu="return false;" rel="term" onclick="IPCPUB.scheme.show_term(\'1539\', \'materials\'); return false;" href="#1539">materials</a>;</li></ul></li><li>"microstructural systems" covers:<ul class="roman"><li>systems of cooperating microstructural devices; and</li><li>microelectro-mechanical or microopto-mechanical systems, which combine on a common substrate the specific <a oncontextmenu="return false;" rel="term" onclick="IPCPUB.scheme.show_term(\'1523\', \'features\'); return false;" href="#1523">features</a> of microstructural devices and electrical or optical components, e.g. for <a oncontextmenu="return false;" rel="term" onclick="IPCPUB.scheme.show_term(\'4680\', \'controlling\'); return false;" href="#4680">controlling</a>, analysing or signalling the functioning of microstructural devices.</li></ul></li></ul></li></ul></div>',
                title2: "",
                definition: "",
                warning: "",
                scheme: "ipc",
                cpcfi: "",
                expandable: "",
                structured: "Unstruct",
                foreign: "",
