                  '<div><p>Note(s) <a rel="versions" data-content="3<br>2006.01" href="#" oncontextmenu="return false;" onclick="return false;"><strong>[2006.01]</strong></a></p><ul class="number"><li>In subclasses  <a rel="symbol" onclick="IPCPUB.scheme.go_to_symbol(\'C01B\');return false;" href="/?notion=scheme&version=20230101&symbol=C01B">C01B</a>-<a rel="symbol" onclick="IPCPUB.scheme.go_to_symbol(\'C01G\');return false;" href="/?notion=scheme&version=20230101&symbol=C01G">C01G</a>, the last place priority rule is applied, i.e. at each hierarchical level, in the absence of an indication to the contrary, a compound is classified in the last appropriate place, e.g. potassium permanganate is classified only as a permanganate compound, in subclass  <a rel="symbol" onclick="IPCPUB.scheme.go_to_symbol(\'C01G\');return false;" href="/?notion=scheme&version=20230101&symbol=C01G">C01G</a>.</li><li>Biocidal, pest repellant, pest attractant or <a oncontextmenu="return false;" rel="term" onclick="IPCPUB.scheme.show_term(\'1553\', \'plant\'); return false;" href="#1553">plant</a> growth regulatory activity of compounds or <a oncontextmenu="return false;" rel="term" onclick="IPCPUB.scheme.show_term(\'1549\', \'preparations\'); return false;" href="#1549">preparations</a> is further classified in subclass  <a rel="symbol" onclick="IPCPUB.scheme.go_to_symbol(\'A01P\');return false;" href="/?notion=scheme&version=20230101&symbol=A01P">A01P</a>.</li></ul></div>',
