                title1:
                  '<div><p>Note(s) <strong>[2006.01]</strong></p><ul class="number"><li>An ingredient in a mixture of fertilisers, or a single fertiliser which contains more than one of the chemical elements on which the subdivision into subclasses is based, is classified only in the <u>first</u> of the appropriate subclasses. Thus, a nitrophosphate or an ammoniated superphosphate is classified in  <a rel="symbol" onclick="IPCPUB.scheme.go_to_symbol(\'C05B\');return false;" href="/?notion=scheme&version=20230101&symbol=C05B">C05B</a> but not in  <a rel="symbol" onclick="IPCPUB.scheme.go_to_symbol(\'C05C\');return false;" href="/?notion=scheme&version=20230101&symbol=C05C">C05C</a>, magnesium phosphate is classified in  <a rel="symbol" onclick="IPCPUB.scheme.go_to_symbol(\'C05B\');return false;" href="/?notion=scheme&version=20230101&symbol=C05B">C05B</a> but not in  <a rel="symbol" onclick="IPCPUB.scheme.go_to_symbol(\'C05D\');return false;" href="/?notion=scheme&version=20230101&symbol=C05D">C05D</a>, and calcium cyanamide in  <a rel="symbol" onclick="IPCPUB.scheme.go_to_symbol(\'C05C\');return false;" href="/?notion=scheme&version=20230101&symbol=C05C">C05C</a> but not in  <a rel="symbol" onclick="IPCPUB.scheme.go_to_symbol(\'C05D\');return false;" href="/?notion=scheme&version=20230101&symbol=C05D">C05D</a>.</li><li>Any ingredient in a mixture, which is considered to represent information <a oncontextmenu="return false;" rel="term" onclick="IPCPUB.scheme.show_term(\'1537\', \'of interest\'); return false;" href="#1537">of interest</a> for search, may also additionally be classified according to Note (1). This can, for example, be the case when it is considered <a oncontextmenu="return false;" rel="term" onclick="IPCPUB.scheme.show_term(\'1537\', \'of interest\'); return false;" href="#1537">of interest</a> to enable searching of mixtures using a combination of classification symbols. Such non-obligatory classification should be given as "additional information".</li></ul></div>',
