                title1:
                  '<div><p>Note(s) <a rel="versions" data-content="3<br>5" href="#" oncontextmenu="return false;" onclick="return false;"><strong>[5]</strong></a></p><ul class="number"><li>Between subclasses  <a rel="symbol" onclick="IPCPUB.scheme.go_to_symbol(\'C12M\');return false;" href="/?notion=scheme&version=20230101&symbol=C12M">C12M</a>-<a rel="symbol" onclick="IPCPUB.scheme.go_to_symbol(\'C12Q\');return false;" href="/?notion=scheme&version=20230101&symbol=C12Q">C12Q</a>, and within each of these subclasses, the last place priority rule is applied, i.e. at each hierarchical level, in the absence of an indication to the contrary, classification is made in the last appropriate place. For example, a fermentation or enzyme-using process involving condition-responsive control is classified in subclass  <a rel="symbol" onclick="IPCPUB.scheme.go_to_symbol(\'C12Q\');return false;" href="/?notion=scheme&version=20230101&symbol=C12Q">C12Q</a>.</li><li>In this class, viruses, undifferentiated human, animal or <a oncontextmenu="return false;" rel="term" onclick="IPCPUB.scheme.show_term(\'1553\', \'plant\'); return false;" href="#1553">plant</a> cells, protozoa, tissues and unicellular algae are considered as microorganisms.</li><li>In this class, unless specifically provided for, undifferentiated human, animal or <a oncontextmenu="return false;" rel="term" onclick="IPCPUB.scheme.show_term(\'1553\', \'plant\'); return false;" href="#1553">plant</a> cells, protozoa, tissues and unicellular algae are classified together with microorganisms. Sub-cellular parts, unless specifically provided for, are classified with the whole cell.</li><li>The codes of subclass  <a rel="symbol" onclick="IPCPUB.scheme.go_to_symbol(\'C12R\');return false;" href="/?notion=scheme&version=20230101&symbol=C12R">C12R</a> are <u>only</u> for <a oncontextmenu="return false;" rel="term" onclick="IPCPUB.scheme.show_term(\'1547\', \'use\'); return false;" href="#1547">use</a> as indexing codes associated with subclasses  <a rel="symbol" onclick="IPCPUB.scheme.go_to_symbol(\'C12C\');return false;" href="/?notion=scheme&version=20230101&symbol=C12C">C12C</a>-<a rel="symbol" onclick="IPCPUB.scheme.go_to_symbol(\'C12Q\');return false;" href="/?notion=scheme&version=20230101&symbol=C12Q">C12Q</a>, so as to provide information concerning the microorganisms used in the processes classified in these subclasses.</li></ul></div>',
