                  '<div><p>Note(s) <strong>[7]</strong></p><ul class="number"><li>This class <u>covers</u>:<ul class="bullet"><li>furnaces, kilns, ovens, retorts, open sintering <a oncontextmenu="return false;" rel="term" onclick="IPCPUB.scheme.show_term(\'1521\', \'apparatus\'); return false;" href="#1521">apparatus</a> and other similar <a oncontextmenu="return false;" rel="term" onclick="IPCPUB.scheme.show_term(\'1521\', \'apparatus\'); return false;" href="#1521">apparatus</a> for heat <a oncontextmenu="return false;" rel="term" onclick="IPCPUB.scheme.show_term(\'1544\', \'treatment\'); return false;" href="#1544">treatment</a> of <a oncontextmenu="return false;" rel="term" onclick="IPCPUB.scheme.show_term(\'1539\', \'materials\'); return false;" href="#1539">materials</a> or articles, and details or accessories therefor, in general;</li><li>the <a oncontextmenu="return false;" rel="term" onclick="IPCPUB.scheme.show_term(\'4679\', \'arrangement of\'); return false;" href="#4679">arrangement of</a> electrical heating elements in or on furnaces.</li></ul></li><li>This class <u>does not cover</u>:<ul class="bullet"><li>combustion <a oncontextmenu="return false;" rel="term" onclick="IPCPUB.scheme.show_term(\'1521\', \'apparatus\'); return false;" href="#1521">apparatus</a> <u>per se</u>, i.e. <a oncontextmenu="return false;" rel="term" onclick="IPCPUB.scheme.show_term(\'1521\', \'apparatus\'); return false;" href="#1521">apparatus</a> for direct combination of oxygen gas and a burnable substance;</li><li>electrical heating elements <u>per se</u>;</li><li>processes carried on within the furnaces.</li></ul></li><li>In this class, the following term is used with the meaning indicated:<ul class="bullet"><li>"furnaces" covers kilns, ovens, or retorts.</li></ul></li></ul></div>',
