              '<div><p>Note(s) <a rel="versions" data-content="4<br>2011.01" href="#" oncontextmenu="return false;" onclick="return false;"><strong>[2011.01]</strong></a></p><ul class="number"><li>This class <u>does not cover</u> reproduction of pictures or patterns by scanning and converting into electrical signals, which is covered by subclass  <a rel="symbol" onclick="IPCPUB.scheme.go_to_symbol(\'H04N\');return false;" href="/?notion=scheme&version=20230101&symbol=H04N">H04N</a>.</li><li>In this class, the following terms are used with the meaning indicated:<ul class="bullet"><li>"records" means photographs or any other kind of latent, directly-visible or permanent storage of pictorial information, which consist of an imagewise distribution of a quantity, e.g. an electric charge pattern, recorded on a carrier member;</li><li>"optical" applies not only to visible light but also to ultra-violet or infra-red radiations.</li></ul></li></ul></div>',
