            title1:
              '<div><p>Note(s) <strong>[2011.01]</strong></p><ul class="number"><li>This class <u>covers</u> :<ul class="bullet"><li>simulators which are concerned with the mathematics of computing the existing or anticipated conditions within the real device or system;</li><li>simulators which demonstrate, by means involving computing, the function of <a oncontextmenu="return false;" rel="term" onclick="IPCPUB.scheme.show_term(\'1521\', \'apparatus\'); return false;" href="#1521">apparatus</a> or of a system, if no provision exists elsewhere;</li><li>image data processing or generation.</li></ul></li><li>This class <u>does not cover</u> :<ul class="bullet"><li>combinations of writing implements with computing devices, which are covered by group  <a rel="symbol" onclick="IPCPUB.scheme.go_to_symbol(\'B43K0029080000\');return false;" href="/?notion=scheme&version=20230101&symbol=B43K0029080000">B43K 29/08</a>;</li><li><a oncontextmenu="return false;" rel="term" onclick="IPCPUB.scheme.show_term(\'4680\', \'control\'); return false;" href="#4680">control</a> functions derived from simulators, in general, which are covered by class  <a rel="symbol" onclick="IPCPUB.scheme.go_to_symbol(\'G05\');return false;" href="/?notion=scheme&version=20230101&symbol=G05">G05</a>, although such functions may be covered by the subclass of this class for the device controlled;</li><li>measurement or analysis of an individual <a oncontextmenu="return false;" rel="term" onclick="IPCPUB.scheme.show_term(\'4678\', \'variable\'); return false;" href="#4678">variable</a> to serve as an input to a simulator, which is covered by class  <a rel="symbol" onclick="IPCPUB.scheme.go_to_symbol(\'G01\');return false;" href="/?notion=scheme&version=20230101&symbol=G01">G01</a>;</li><li>simulators regarded as teaching or training devices which is the case if they give perceptible sensations having a likeness to the sensations a student would experience in reality in response to actions taken by him. Such simulators are covered by class  <a rel="symbol" onclick="IPCPUB.scheme.go_to_symbol(\'G09\');return false;" href="/?notion=scheme&version=20230101&symbol=G09">G09</a>;</li><li>components of simulators, if identical with real devices or machines, which are covered by the relevant subclass for these devices or machines and not by class  <a rel="symbol" onclick="IPCPUB.scheme.go_to_symbol(\'G09\');return false;" href="/?notion=scheme&version=20230101&symbol=G09">G09</a>.</li></ul></li><li>In this class, the following terms or expressions are used with the meanings indicated:<ul class="bullet"><li>"data" is used as the synonym of "information". Therefore, the term "information" is not used in subclass  <a rel="symbol" onclick="IPCPUB.scheme.go_to_symbol(\'G06C\');return false;" href="/?notion=scheme&version=20230101&symbol=G06C">G06C</a>;</li><li>"ICT [information and communication technology]" also covers "IT [information technology]";</li><li>"calculating or computing" includes, <u>inter alia</u>, operations on numerical <a oncontextmenu="return false;" rel="term" onclick="IPCPUB.scheme.show_term(\'1546\', \'values\'); return false;" href="#1546">values</a> and on data expressed in numerical form. Of these terms "computing" is used throughout the class; "computation" is derived from this interpretation of "computing". In the French language the term "calcul" will serve for either term;</li><li>"simulator" is a device which may <a oncontextmenu="return false;" rel="term" onclick="IPCPUB.scheme.show_term(\'1547\', \'use\'); return false;" href="#1547">use</a> the same time scale as the real device or operate on an expanded or compressed time scale. In interpreting this term models of real devices to reduced or expanded scales are not regarded as simulators;</li><li>"record carrier" means a body, such as a cylinder, disc, card, tape, or wire, capable of permanently holding information, which can be read-off by a sensing element movable relative to the recorded information.</li></ul></li><li>Attention is drawn to the Notes following the title of section G, especially as regards the definition of the term "<a oncontextmenu="return false;" rel="term" onclick="IPCPUB.scheme.show_term(\'4678\', \'variable\'); return false;" href="#4678">variable</a>".</li></ul></div>',
