            title1:
              '<div><p>Note(s) </p><ul class="number"><li>This class <u>\ncovers</u>\n all sound-emitting devices, in general, whether or not they may be considered as being musical.</li><li>In this class, the following expression is used with the meaning indicated:<ul class="bullet"><li>"musical instrument" does not exclude devices emitting a single sound signal.</li></ul></li><li>The following Class Index is given in place of subclass indexes, to show the grouping of the elaborations belonging to different subclasses, under the following three fundamental types:<ul class="bullet"><li>wind instruments;</li><li>string instruments;</li><li>percussion instruments,</li></ul><p>which relate clearly to the majority of instruments.</p></li><li>There are of course some instruments of which the principle of operation belongs less clearly to one of the three types mentioned in Note (3). They correspond to groups  <a rel="symbol" onclick="IPCPUB.scheme.go_to_symbol(\'G10D0017000000\');return false;" href="/?notion=scheme&version=20230101&symbol=G10D0017000000">G10D 17/00</a>\n or  <a rel="symbol" onclick="IPCPUB.scheme.go_to_symbol(\'G10K0007000000\');return false;" href="/?notion=scheme&version=20230101&symbol=G10K0007000000">G10K 7/00</a>,  <a rel="symbol" onclick="IPCPUB.scheme.go_to_symbol(\'G10K0009000000\');return false;" href="/?notion=scheme&version=20230101&symbol=G10K0009000000">G10K 9/00</a>\n or  <a rel="symbol" onclick="IPCPUB.scheme.go_to_symbol(\'G10K0015040000\');return false;" href="/?notion=scheme&version=20230101&symbol=G10K0015040000">G10K 15/04</a>, all the other groups normally finding a definite place.</li></ul></div>',
